export default (function(a,b,c,d,e,f,g,h){return {data:{NBPqgVN4Ey:{data:{id:1983,attributes:{imdbId:"tt5690810",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTU2OTAxNjI2OV5BMl5BanBnXkFtZTgwNzc2NjUwODM@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.6\u002F10"},{Source:"Rotten Tomatoes",Value:"62%"},{Source:"Metacritic",Value:"60\u002F100"}],item_lang:{data:{id:2646,attributes:{title:c,plot:"As a rebellious and motherless child, Ophelia is taken into Elsinore Castle by Queen Gertrude as one of her most trusted ladies-in-waiting. Soon enough, Ophelia captures the affections of the young Prince Hamlet. A passionate romance kindles between the 2 in secret as the kingdom is on the brink of war amidst its own political intrigue and betrayal. When Hamlet's father is murdered and the prince's wits begin to unravel into an insatiable quest for vengeance, Ophelia sharply navigates the rules of power in Denmark all while struggling to choose between her true love and her own life.",slug:"ophelia"}}},books:{data:[{id:9943,attributes:{title:c,description:f,thumbnail:g,authors:[b],firstBook:true,published:h,publisher:e,subtitle:a}},{id:9944,attributes:{title:c,description:f,thumbnail:g,authors:[b],firstBook:d,published:h,publisher:e,subtitle:a}},{id:9945,attributes:{title:c,description:"Calvin J. Hamilton features information and statistics about Ophelia, the second innermost moon of Uranus. The information is offered as part of Views of the Solar System. Hamilton includes an image of Ophelia, as well as statistics about the mass, orbital period, mean density, magnitude, equatorial radius, orbital eccentricity, mean orbital velocity, and other facts on Ophelia.",thumbnail:a,authors:[b],firstBook:d,published:"1000-01-01",publisher:a,subtitle:a}},{id:9946,attributes:{title:"Lady Macbeth's Daughter",description:"Raised by three strange sisters, Albia has never known the secrets of her parentage. But when Macbeth seeks out the weird sisters to foretell his fate, his life is entangled with his unknown daughter's. When Albia foresees the terrible future, she becomes determined to save Macbeth's rival-and the man she loves-from her murderous father. Klein's seamlessly drawn tale makes it seem impossible that Albia was not part of Shakespeare's original play.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=TkuAEKcQVvMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2010-09-28",publisher:e,subtitle:a}},{id:9947,attributes:{title:"Ich, Ophelia",description:a,thumbnail:a,authors:[b],firstBook:d,published:"2018-11-12",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940949250}}("","Lisa Klein","Ophelia",null,"Bloomsbury Publishing USA","NOW A MAJOR MOTION PICTURE! If you think you know Ophelia and Hamlet's story, think again... \"A spellbinding tale of love, murder, and revenge.\" -- VOYA As ambitious and witty as she is beautiful, Ophelia is quick to catch the eye of the captivating prince Hamlet. Their love blossoms in secret, but bloody deeds soon turn Denmark into a place of madness, and Ophelia may be forced to choose between her relationship and her own life. In desperation, she devises a plan to escape from Elsinore Castle forever... with one very dangerous secret. Ophelia takes center stage in this bold and thrilling reimagining of Shakespeare's famous tragedy, the story of a young woman falling in love, searching for her place in the world, and finding the strength to survive.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=PYOse2rni60C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2008-12-01"))